import React from "react"


class Innerlayout extends React.Component{
    render(){
        const mystyle ={
            background : "" ,
            padding : "20px", 
            height : "1170px",
            width : "970px",
        }
        return(
            <>
            <div style={mystyle}>
        
            </div>
            </>
        )
    }

}

export default Innerlayout
